import React, { Component } from 'react'

export class Q3 extends Component {
    render() {
        return (
            <div style={{ padding: "15px" }}>
                <h1 style={{
                        textAlign: "left",
                        padding: "15px",
                        fontSize: "30px",
                        color: "darkred"
                    }}
                >
                    Q2: Level 100:{" "}
                </h1>
                <p style={{padding}}>Our national retail client has a 200-store branch network, they want to do a big promotion give-away. 
                    To participate, customers must enter their email address with a unique code (which is printed on their dockets) into OUR website. 
                    No store has more than 10,000 customers/day.</p>
            </div>
        )
    }
}

export default Q3
